import {Link} from "react-router-dom";


function Priziv(props) {
return(
<div>
    <ul>
        <li>
            <Link to="/">Призывники</Link>
        </li>
    </ul>
    <h1>Призывники</h1>
    <ul>
        {props.prizivnik.map(el =>
        <li key={el.id}>
            <Link to={`/${el.surname}`}>{el.surname}</Link>
            <br/>Местоположение: {el.adress}
        </li>)}
    </ul>
</div>
)
}

export default Priziv;
